description:
Resolves dependencies between JavaScript files based on declared reference paths.
e.g.
  /// <reference path="~/Scripts/jquery-1.6.2.min.js"/>

Smart internationalization for .NET web apps;
    Globally recognized interface; localize like the big kids
    Localizes everything; controller calls, views, validation attributes, and routes.

Extends System.String by following methods: 
    
      a) ShortenTo(int length): Crops a text to fit into certain number of chars. Appends ... if it has to be cropped; 
      
      b) WrapAt(int margin): Nicely wraps a text at the given margin. Tries not to split in the middle of words.

Resolves dependencies between JavaScript files based on declared reference paths.
e.g.
  /// <reference path="~/Scripts/jquery-1.6.2.min.js"/>
